import './header.css'

export default function Header() {
  return (
    <div className="header">
        <div className="headerTitles">
            <span className="headerTitleLg">Blog</span>
        </div>
        <img className='headerImg' src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/cf2ee033-82b6-4233-9fad-5170ceec3779/de84q9u-2beec4a4-87d6-44b6-a0f6-967ee276dda0.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..q7uOUKdv-Uxblmd8pxSWVaWCr09Wncj1OC-SzFlP_Zg" alt="celeste"></img>
    </div>
  )
}
